    --background-color1: #ebaa60;
    --background-color2: #381f06;
    --loader-color1: #46bed9;
    --loader-color2: #46bed9;
    --inset-shadow-color: #437bd0;
    --border-shadow-color: #4f3418;
  }

  .loader_c {
    position: absolute;
    top: 0;
    left: 0;
    width: 100vw;
    height: 100vh;
    background: #888888;
    z-index: 20;
  }

  .loader::before, .loader::after {
    content: "";
    display: block;
    position: absolute;
  }

  .loader::before {
    top: 0;
  }

  .loader::after {
    bottom: 0;
  }

  @keyframes blink {
    0% {
      opacity: 1;
    }
    99% {
      opacity: 0;
    }
    100% {
      opacity: 0;
    }
  }

  .loader_c.custom {
    background: radial-gradient(circle, var(--background-color1) 0%, var(--background-color2) 80%);
    background-size: 100% 100%;
  }

  .loader {
    background: var(--logo-image) top center/auto 100% no-repeat;
    background-size: contain;
    position: absolute;
    left: 50%;
    transform: translate(-50%, -50%);
    max-height: 80vh;
    width: 50%;
  }

  .loader.custom:before, .loader.custom::after {
    border-radius: 40px;
    width: 100%;
    margin: 0 auto;
    background-size: 100% 100%;
    background-repeat: repeat-x;
    z-index: 22;
  }

  .loader.custom::after {
    width: 100%;
    background: linear-gradient(45deg, var(--loader-color2) 0%, var(--loader-color2) 50%, var(--loader-color1) 50.1%, var(--loader-color1) 100%);
    box-shadow: 0 0 8px 3px var(--inset-shadow-color) inset;
    top: 100.5%;
  }

  .loader.custom::before {
    width: 102%;
    background: transparent;
    box-shadow: -3px 0 8px 2px var(--border-shadow-color) inset;
    top: 100%;
  }

  .l-text {
    width: 100%;
    text-align: center;
    position: absolute;
    top: 120%;
    color: #fff;
    letter-spacing: 0.5px;
    font-size: 5vw;
    font-weight: 600;
    font-family: "Trebuchet MS", "Lucida Sans Unicode", "Lucida Grande", "Lucida Sans", Arial, sans-serif;
    transform: scaleY(0.85);
    display: flex;
    justify-content: center;
  }

  .dots {
    letter-spacing: 0;
    margin-left: 3px;
  }

  .dots > span {
    opacity: 0;
    display: inline-block;
    background: #fff;
    border-radius: 50%;
    animation: blink 1.5s infinite backwards;
    animation-fill-mode: both;
  }

  .dots > span:nth-child(2) {
    animation-delay: .2s;
  }

  .dots > span:nth-child(3) {
    animation-delay: .4s;
  }

  @media (orientation: portrait) {
    @keyframes loading {
      0% {
        width: 5%;
      }
      100% {
        width: 130%;
      }
    }
    .loader {
      height: 30%;
      top: 45%;
    }

    .loader.custom:before {
      height: 10%;
      width: 132%;
      margin-left: -16.3%;
    }

    .loader.custom::after {
      height: 9%;
      width: 0;
      margin-left: -15%;
      animation: loading 1.5s linear forwards;
    }

    .l-text {
      font-size: 5vw;
    }

    .dots > span {
      width: 1vw;
      height: 0.55vh;
    }
  }

  @media (orientation: landscape) {
    @keyframes loading {
      0% {
        width: 5%;
      }
      100% {
        width: 100%;
      }
    }
    .loader {
      height: 50%;
      top: 40%;
    }

    .loader.custom:before {
      height: 12%;
      width: 101%;
      margin-left: -0.6%;
    }

    .loader.custom::after {
      height: 11%;
      width: 0;
      margin-left: 0;
      animation: loading 1.5s linear forwards;
    }

    .l-text {
      font-size: 5vh;
    }

    .dots > span {
      width: 1vh;
      height: 0.55vw;
    }
  }
</style>

    <div class="loader_c custom">
        <div class="loader custom">
            <div class="l-text">
                    <span></span>
                    <span></span>
                    <span></span>
                </div>
            </div>
        </div>
